Comment:
My son and I are victims of proven housing discrimination in a court of law. I am now an Activist with the ACLU and an Advocate for the mentally ill and also the homeless in regards to housing discrimination. My son and I are also the proud business Owners of the soon to open, DSHOP JMAN"S Treasures Thrift Store were all proceeds are going to benefit the mentally ill and also the homeless. We are writing our first book with prayers of it becoming a true life story, a movie, based on the many struggles that we have experienced in our lives.  I am interested in anything that I can to do to stand up for the rights of the mentally ill and the homeless as a strong woman with a strong voice. I must use such voice for the good and not to perpetuate stigma and hate. My son and I use our time and energy to help others that are homeless and also with or without mental illness. He has schizophrenia, in advocating for their best interest. We have a long story and a long road of the damages and effects of housing discrimination as proven in a court of law. We have suffered with the damages and effects of the monster of injustice since 2014. I want to partner with someone who is like me and has the desires to do as my son and I have in supporting others. We MUST advocate in helping the homeless and the mentally ill in any way that we can. Please contact me at your earliest convenience and thank you for your warm consideration at reading this communication.

Respectfully;

Denise Newton Fitzpatrick
